import React from "react";
import "./SearchPlayers.css";
import { Button, Dropdown, Space } from "antd";
import { DownOutlined, UserOutlined } from "@ant-design/icons";

const SearchPlayers = () => {
  const items = [
    {
      label: "1st menu item",
      key: "1",
      icon: <UserOutlined />,
    },
    {
      label: "2nd menu item",
      key: "2",
      icon: <UserOutlined />,
    },
    {
      label: "3rd menu item",
      key: "3",
      icon: <UserOutlined />,
      danger: true,
    },
    {
      label: "4rd menu item",
      key: "4",
      icon: <UserOutlined />,
      danger: true,
      disabled: true,
    },
  ];
  const menuProps = {
    items,
    onClick: handleMenuClick,
  };

  return (
    <div className="search-players">
      <h2 className="search-players-header">Search Players</h2>
      <input type="text" placeholder="Search by name or team..." />
      <Dropdown menu={menuProps}>
        <Button>
          <Space>
            Button
            <DownOutlined />
          </Space>
        </Button>
      </Dropdown>
      <div className="search-results">
        {/* Placeholder for search results */}
        <div className="search-result">
          <img
            src="https://example.com/player.png"
            alt="Player"
            className="player-image"
          />
          <div className="player-info">
            <span className="player-name">Player Name</span>
            <span className="player-team">Player Team</span>
            <span className="player-stats">Player Stats</span>
          </div>
          <button className="add-player-btn">+</button>
        </div>
        {/* Add more search results as needed */}
      </div>
    </div>
  );
};

export default SearchPlayers;
